import React, { Component } from "react";

class Addpresentation extends Component {
  render() {
    return (
      <div>
        <form>
          <label>Presenter</label>
          <input
            type="text"
            placeholder="Elease Enter Presenter Name"
            name="presenter"
            value={this.state.value}
          />
        </form>
      </div>
    );
  }
}
export default Addpresentation;
